gco:CharacterString.#text:
Coded-wire tags allow Canada to fulfill obligations for International Pacific Salmon Treaty initiatives and provide valuable information, including:

?abundance, distribution and survival;
?trends for planning next year?s fishing season;
?run timing in salt and freshwater areas.

gmd:LocalisedCharacterString.#text:
Les micromarques magnétisées codées permettent au Canada de remplir ses obligations dans le cadre du Traité international sur le saumon du Pacifique et d?obtenir des renseignements précieux tels que :

?l'abondance, la répartition et la survie;
?les tendances permettant la planification de la saison de pêche suivante;
?les moments des montaisons dans les zones d'eau douce et salée.
